//child components
import HeaderNavBar from '../components/headerNavbar';
import Map from '../components/map';
import ArtistsSideBar from '../components/artistsSideBar';

//design
import 'bootstrap/dist/css/bootstrap.min.css';

const HomePage = (props) => {
      const { artists, locations, selectedArtistsCB } = props;

      const selectArtist = ({ a }) => {
            console.log('select artists from homepage');
            selectedArtistsCB({ a });
      };
      const headerText = 'Admin';

      const goLoginPage = () => {
            console.log('link to login');
      };

      //homepage renderding
      return (
            <div>
                  <header>
                        <HeaderNavbar
                              handleText={headerText}
                              handleAction={goLoginPage}
                        />
                  </header>

                  <div className='container'>
                        {/* {console.log(genres)} */}

                        <div>
                              <Map
                                    locations={locations}
                                    selectedArtistsCB={selectArtist}
                              />
                        </div>
                        <div>
                              <ArtistsSideBar
                                    artists={artists}
                                    selectedArtistsCB={selectArtist}
                              />
                        </div>
                  </div>
            </div>
      );
};

export default HomePage;
